import React, { Component } from 'react';
import ReactDOM from 'react-dom';

export class MyForm extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            email: '',
            password: '',
        }
    }

    render() {
        return (
        <div>
            <label> Email
                <input type="email" onChange={this.setEmail}></input>
            </label>
            <label> Password
                <input type="password" onChange={this.setPass}></input>
            </label>
            <button type="submit" onClick={() => this.submit()}>Login</button>
        </div>
        );
    }

    setEmail = (obj) => {
        console.log('Email: ', obj.target.value)
        this.setState({
            email: obj.target.value
        })
    }

    setPass = (obj) => {
        console.log('Password: ', obj.target.value)
        this.setState({
            password: obj.target.value
        })
    }

    submit(){
        var self = this.state;
        console.log(self);

        if(self.email === '' || self.password === ''){
            alert('Não Logado');
        }else{
            alert('Logado!');
        }
    }
}

export class SecondComponent extends React.Component {

    render() {
        return (
        <div>
            <h2>Eu sou o componente 2</h2>
        </div>
        );
    }
}

export class UltimoComponente extends React.Component {

    render() {
        return (
        <div>
            <p>Eu sou o Ultimo Componente</p>
        </div>
        );
    }
}

